import React from "react";

import TuscanyData from '../DB/Tuscany.json';

import '../styles/Tour_Packages.css';

export default function Tours() {
  return (
    <section>
    <section>
      {TuscanyData.map((tour, index) => (
        <section key={tour.id}>
          <img src={tour.img} alt={tour.title} /> {/* Use tour.img for image URL */}
          <p className="title"><strong>{tour.title}</strong></p>
          <p className="price">from {tour.price}</p>

          <section className="tour">
            <section className="descrip">
              {/* <img className="icon" src={clndr} alt="Choose a date" /> */}
              <p>{tour.visit}</p>
            </section>

            <section className="tour">
              <section className="descrip">
                {/* <img className="icon" src={ppl} alt="choose a number of people" /> */}
                <p>{tour.people} PP.</p>
              </section>
            </section>
          </section>

          <section className="description">
            <p>{tour.short_description}</p>
          </section>

          <section> {/* Optional section for additional information */} </section>
        </section>
      ))}
    </section>

   

    </section>
  );
}
